import React, { Component } from "react";
import Slider from "react-slick";
import styled from 'styled-components'
import girl from '../photos/girl.jpg'
import girl2 from '../photos/girl.jpg'
import girl3 from '../photos/girl.jpg'
import girl4 from '../photos/girl.jpg'
import girl5 from '../photos/girl.jpg'
import girl6 from '../photos/girl.jpg'

const Div = styled.div`
width:200px;
height:200px;
background-position:center;
background-repeat:no-repeat;
background-size:cover;
`

const H1 = styled.h1`
text-align:center;
`

const Wrapper = styled.div`
display:grid;
justify-content: center;
  align-items: center;
background:green
`

export default class Girls extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 3
        };
        return (
            <div >
                <div>
                    <h2> Multiple items </h2>
                    <Slider {...settings} style={{ width: "90%" }}>
                        <Wrapper>
                            <Div style={{ backgroundImage: `url(${girl})` }}></Div>
                            <H1>asd</H1>
                        </Wrapper>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl2})` }}></Div>
                        </div>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl3})` }}></Div>
                        </div>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl4})` }}></Div>
                        </div>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl5})` }}></Div>
                        </div>
                        <div>
                            <Div style={{ backgroundImage: `url(${girl6})` }}></Div>
                        </div>

                    </Slider>
                </div>
            </div >
        );
    }
}
